import {createSlice} from 'redux-toolkit';

export const CarSlice = createSlice({
    name: 'Cart',
    initialState: [],
    reducers: {
        add:() => {},
        remove:() => {}
    }
})

export const {add, remove} = CarSlice.actions;
export default CarSlice.reducer;
